description:
Verenigde Staten
Komedie / Romantiek
97 minuten

een mooie film

met Sarah Michelle Gellar, Alec Baldwin en Richard Dreyfuss

Brett Eisenberg is een New Yorkse uitgeefster, die denkt dat haar geluk direct gekoppeld wordt aan de man waar ze een relatie 
mee weet aan te knopen. Totdat ze opeens een oudere, invloedrijke en erg machtige man ontmoet en ze met hem een relatie krijgt. 
Ze denkt dat al haar problemen nu tot het verleden behoren, maar die blijken niets in verhouding met wat zal komen.
